import { memo } from "react";

interface iconButtonProp {
    icon: string;
    onClick?: () => void
    disabled?: boolean
}

const IconButton = ({ icon, onClick, disabled }: iconButtonProp) => {
    return (
        <>
            <button className={`button ${className}`} style={{
                width: `${width}`,
                margin: `${margin}`,
                height: `${height}`,
                border: "none"
            }} disabled={!disabled} onClick={onClick} >
                <i className={icon}></i>
            </button>
        </>
    )
}

export default memo(IconButton)
